// src/index.js
import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './index.css';
import App from './App'; // Import the App component
import LoginPage from './pages/LoginPage'; // Import the LoginPage
import CustomerLandingPage from './pages/CustomerLandingPage';
import SmartDoorlockPage from './pages/SmartDoorlockPage'; // Import the SmartDoorlockPage
import CartPage from './pages/CartPage'; // Import the CartPage
import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<App />}>
          <Route path="products/doorlocks" element={<SmartDoorlockPage />} />
          <Route path="cart" element={<CartPage />} />
          <Route path="CustomerLogin" element={<LoginPage />} />
          <Route path="CustomerLandingPage" element={<CustomerLandingPage />} />
        </Route>
      </Routes>
    </BrowserRouter>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
